export function handleInitSetting(
  setCarouselWidth,
  carouselRef,
  setOneWidth,
  carouselWidth,
  setCarouselCurrentPosition,
  oneWidth,
) {
  setCarouselWidth(carouselRef.current.clientWidth);
  setOneWidth(carouselWidth / 2);
  setCarouselCurrentPosition(oneWidth / 2);
}

export default handleInitSetting;
